    "summary": "You can never have too many dessert recipes, so give Banana Split Sundae Ice Cream Cake a try. This recipe serves 18. One serving contains <b>449 calories</b>, <b>6g of protein</b>, and <b>22g of fat</b>. For <b>86 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. 18 people were impressed by this recipe. This recipe from Foodista requires graham cracker crumbs, walnuts, bananas, and vanillan extract. It can be enjoyed any time, but it is especially good for <b>Summer</b>. From preparation to the plate, this recipe takes about <b>about 45 minutes</b>. With a spoonacular <b>score of 24%</b>, this dish is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/banana-split-ice-cream-sundae-265147\">Banana Split Ice Cream Sundae</a>, <a href=\"https://spoonacular.com/recipes/banana-split-ice-cream-cake-415846\">Banana Split Ice Cream Cake</a>, and <a href=\"https://spoonacular.com/recipes/banana-split-ice-cream-cake-528119\">Banana Split Ice Cream Cake</a>.",
