    "summary": "The recipe Peanut Butter and Apple Oatmeal Breakfast Bars can be made <b>in around roughly 45 minutes</b>. This recipe serves 8. This breakfast has <b>281 calories</b>, <b>7g of protein</b>, and <b>9g of fat</b> per serving. For <b>49 cents per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. It is brought to you by Foodista. 14 people have tried and liked this recipe. A mixture of cinnamon, vanillan extract, apple, and a handful of other ingredients are all it takes to make this recipe so flavorful. It is a good option if you're following a <b>lacto ovo vegetarian</b> diet. With a spoonacular <b>score of 40%</b>, this dish is solid. <a href=\"https://spoonacular.com/recipes/caramel-apple-peanut-butter-oatmeal-bars-573327\">Caramel Apple Peanut Butter Oatmeal Bars</a>, <a href=\"https://spoonacular.com/recipes/cacao-peanut-oatmeal-breakfast-bars-with-banana-799255\">Cacao Peanut Oatmeal Breakfast Bars with Banana</a>, and <a href=\"https://spoonacular.com/recipes/peanut-butter-oatmeal-breakfast-cookies-572279\">Peanut Butter-Oatmeal Breakfast Cookies</a> are very similar to this recipe.",
