    "summary": "The recipe Savory Cheese Dill Scones could satisfy your Scottish craving in roughly <b>45 minutes</b>. One serving contains <b>215 calories</b>, <b>6g of protein</b>, and <b>11g of fat</b>. This recipe serves 12 and costs 30 cents per serving. It works well as an inexpensive morn meal. 40 people have tried and liked this recipe. A mixture of cottage cheese, a pinch of baking soda, pepper, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a good option if you're following a <b>vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 28%</b>. This score is not so super. Try <a href=\"https://spoonacular.com/recipes/savory-dill-and-caraway-scones-394210\">Savory Dill and Caraway Scones</a>, <a href=\"https://spoonacular.com/recipes/cheese-dill-scones-17417\">Cheese Dill Scones</a>, and <a href=\"https://spoonacular.com/recipes/savory-three-cheese-cream-cheese-pumpkin-scones-612392\">Savory Three Cheese Cream Cheese Pumpkin Scones</a> for similar recipes.",
