    "summary": "You can never have too many side dish recipes, so give Grilled Eggplant and Heirloom Tomato Stacks With Basil and Tomato Coulis a try. For <b>$2.05 per serving</b>, this recipe <b>covers 9%</b> of your daily requirements of vitamins and minerals. This recipe makes 5 servings with <b>206 calories</b>, <b>11g of protein</b>, and <b>17g of fat</b> each. This recipe from Foodista has 7 fans. It can be enjoyed any time, but it is especially good for <b>The Fourth Of July</b>. It is a good option if you're following a <b>gluten free, primal, vegetarian, and ketogenic</b> diet. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. A mixture of olive oil, pecorino romano cheese, plum tomatoes, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 49%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/grilled-eggplant-tomato-stacks-695540\">Grilled Eggplant & Tomato Stacks</a>, <a href=\"https://spoonacular.com/recipes/grilled-eggplant-tomato-and-feta-stacks-378085\">Grilled Eggplant, Tomato and Feta Stacks</a>, and <a href=\"https://spoonacular.com/recipes/grilled-eggplant-stacks-with-tomato-and-feta-24025\">Grilled Eggplant Stacks With Tomato And Feta</a> for similar recipes.",
