    "summary": "One serving contains <b>279 calories</b>, <b>6g of protein</b>, and <b>10g of fat</b>. For <b>$1.02 per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 40 would say it hit the spot. It is a good option if you're following a <b>vegetarian</b> diet. A mixture of full-fat cream cheese, double cream, ground cinnamon, and a handful of other ingredients are all it takes to make this recipe so tasty. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is not so super. Try <a href=\"https://spoonacular.com/recipes/caramel-apple-pumpkin-spice-muffins-with-salted-caramel-glaze-612064\">Caramel Apple Pumpkin Spice Muffins with Salted Caramel Glaze</a>, <a href=\"https://spoonacular.com/recipes/easy-salted-caramel-apple-tart-615510\">Easy Salted Caramel Apple Tart</a>, and <a href=\"https://spoonacular.com/recipes/apple-mosaic-tart-with-salted-caramel-48259\">Apple Mosaic Tart With Salted Caramel</a> for similar recipes.",
