    "instructions": "<ol><li>FOR THE CREPES: Combine all liquid ingredients in a blender. Add the dry ingredients and 1/4 cup melted butter; mix on high.</li><li>Let batter rest for 30 minutes.</li><li>Heat a nonstick 10 inch skillet over medium high heat. Brush bottom and sides of pan with a bit of melted butter.</li><li>Ladle 1/2 cup batter into skillet and swirl to coat bottom evenly. Cook until lightly browned, about 1-2 minutes. Using a spatula or your fingers, flip the crepe and cook the other side until lightly browned, about 30 seconds to 1 minute.</li><li>Transfer crepes to a platter. Layer crepes over each other with parchment paper in between.</li><li>If necessary, add more butter to the pan. Repeat with the rest of the batter.</li><li>FOR THE SAUCE: Melt 1/4 cup butter in a skillet over LOW fire. Add the sugar and allow to melt. Be patient. Make sure that the heat is at its lowest. Add the lemon juice and mix well. Add the lemon zest.</li><li>Add the crepes, 3-4 at a time and allow to cook in the sauce for 1 minute. Remove from the pan. Arrange on a plate and pour the sauce over the crepes and serve warm.</li><li>Makes 8 crepes. Serving size is 2 crepes.</li></ol>",
