    "summary": "The recipe Bing's Mango Salsan is ready <b>in roughly roughly 45 minutes</b> and is definitely a spectacular <b>gluten free, dairy free, lacto ovo vegetarian, and vegan</b> option for lovers of Mexican food. For <b>$2.08 per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. This hor d'oeuvre has <b>55 calories</b>, <b>1g of protein</b>, and <b>0g of fat</b> per serving. This recipe from Foodista requires sugar, lime zest, chilli, and mint leaves. 7 people have made this recipe and would make it again. All things considered, we decided this recipe <b>deserves a spoonacular score of 43%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/grilled-mango-chicken-with-strawberry-mango-salsa-733371\">Grilled Mango Chicken with Strawberry Mango Salsa</a>, <a href=\"https://spoonacular.com/recipes/sunny-hot-salsa-pineapple-mango-kiwi-salsa-148792\">Sunny & Hot! Salsa (Pineapple Mango Kiwi Salsa)</a>, and <a href=\"https://spoonacular.com/recipes/mango-salsa-58765\">Mango Salsa</a> for similar recipes.",
