    "imageType": "jpg",
    "summary": "Pecan Pumpkin Pie Dessert Pizza with Maple Whipped Cream might be just the <b>Mediterranean</b> recipe you are searching for. For <b>$1.41 per serving</b>, you get a dessert that serves 10. One serving contains <b>394 calories</b>, <b>6g of protein</b>, and <b>29g of fat</b>. <b>Thanksgiving</b> will be even more special with this recipe. 25 people have tried and liked this recipe. From preparation to the plate, this recipe takes around <b>45 minutes</b>. A mixture of brown sugar, pumpkin pie filling/mix, pecans, and a handful of other ingredients are all it takes to make this recipe so delicious. All things considered, we decided this recipe <b>deserves a spoonacular score of 37%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/no-bake-pumpkin-tart-with-maple-pecan-whipped-cream-555266\">No-Bake Pumpkin Tart with Maple-Pecan Whipped Cream</a>, <a href=\"https://spoonacular.com/recipes/maple-and-toasted-pecan-pie-with-maple-whipped-cream-522808\">Maple and Toasted Pecan Pie with Maple Whipped Cream</a>, and <a href=\"https://spoonacular.com/recipes/maple-pumpkin-mini-cheesecakes-with-brown-sugar-maple-whipped-cream-579456\">Maple Pumpkin Mini Cheesecakes with Brown Sugar Maple Whipped Cream</a> for similar recipes.",
