    "summary": "The recipe Caramelised Onion and Mushroom Quiche could satisfy your Mediterranean craving in about <b>around 45 minutes</b>. This main course has <b>428 calories</b>, <b>14g of protein</b>, and <b>29g of fat</b> per serving. For <b>$1.35 per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. This recipe serves 4. It is brought to you by Foodista. 17 people found this recipe to be flavorful and satisfying. A mixture of mushrooms, thyme, eggs, and a handful of other ingredients are all it takes to make this recipe so tasty. With a spoonacular <b>score of 35%</b>, this dish is rather bad. Similar recipes are <a href=\"https://spoonacular.com/recipes/caramelised-onion-and-mushroom-spread-116650\">Caramelised Onion and Mushroom Spread</a>, <a href=\"https://spoonacular.com/recipes/mushroom-and-caramelised-onion-polenta-bites-555879\">Mushroom and Caramelised Onion Polenta Bites</a>, and <a href=\"https://spoonacular.com/recipes/onion-bacon-mushroom-quiche-148001\">Onion, Bacon, Mushroom Quiche</a>.",
