    "instructions": "Heat the oven to 400F. Dock the pie shell with a fork and bake for 10 to 15 minutes until lightly golden.\nIn the meantime, heat the olive oil. Add the onions along with the garlic and chilli flakes and cook on high until the onion caramelise (about ten minutes).\nNow add the mushrooms and continue to cook on high so the mushrooms caramelise as well, about five minutes. Take off the fire, add the thyme and salt and pepper to taste.\nBeat the eggs in a large bowl with the cream and half the quantity of cheese. Add the onion-mushroom mixture and mix well.\nPlace the pie shell on a cookie tray to catch any spillage. Pour the filling into the pie shell. Top the quiche with the remaining cheese.\nDrop the temperature to 375F and cook until the filling is set and golden. Serve when still warm from the oven.",
