    "summary": "Bing's Banana Cake might be just the dessert you are searching for. One serving contains <b>263 calories</b>, <b>4g of protein</b>, and <b>19g of fat</b>. This dairy free and vegetarian recipe serves 10 and costs <b>32 cents per serving</b>. Only a few people made this recipe, and 6 would say it hit the spot. Head to the store and pick up baking powder, sugar, eggs, and a few other things to make it today. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 29%</b>. This score is not so excellent. Try <a href=\"https://spoonacular.com/recipes/rum-infused-bing-cherry-chocolate-chip-olive-oil-cake-621819\">Rum-infused Bing Cherry & Chocolate Chip Olive Oil Cake</a>, <a href=\"https://spoonacular.com/recipes/bing-bongs-629956\">Bing Bongs</a>, and <a href=\"https://spoonacular.com/recipes/bing-cherry-pie-70765\">Bing Cherry Pie</a> for similar recipes.",
