    "summary": "Loaded Baked Potato Soup with Crispy-Fried Potato Skins might be a good recipe to expand your main course recipe box. One serving contains <b>466 calories</b>, <b>18g of protein</b>, and <b>28g of fat</b>. This recipe serves 8. For <b>$1.5 per serving</b>, this recipe <b>covers 16%</b> of your daily requirements of vitamins and minerals. 25 people found this recipe to be flavorful and satisfying. It is brought to you by Foodista. A mixture of flour, russet potatoes, onion, and a handful of other ingredients are all it takes to make this recipe so yummy. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It will be a hit at your <b>Autumn</b> event. Taking all factors into account, this recipe <b>earns a spoonacular score of 48%</b>, which is good. If you like this recipe, take a look at these similar recipes: <a href=\"https://spoonacular.com/recipes/loaded-baked-potato-soup-with-crispy-bacon-624075\">Loaded Baked Potato Soup with Crispy Bacon</a>, <a href=\"https://spoonacular.com/recipes/loaded-baked-potato-skins-550539\">Loaded Baked Potato Skins</a>, and <a href=\"https://spoonacular.com/recipes/mitchells-loaded-baked-potato-skins-274365\">Mitchell's Loaded Baked Potato Skins</a>.",
