    "summary": "Pastan e Fagioli (Pastan and Beans) is a Mediterranean soup. This recipe makes 6 servings with <b>187 calories</b>, <b>8g of protein</b>, and <b>6g of fat</b> each. For <b>64 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista has 13 fans. Head to the store and pick up pepper flakes, cannellini beans, parsley, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. Taking all factors into account, this recipe <b>earns a spoonacular score of 50%</b>, which is solid. Similar recipes are <a href=\"https://spoonacular.com/recipes/pasta-e-fagioli-con-salsicce-pasta-and-beans-with-sausage-106972\">Pastan e Fagioli con Salsicce (Pastan and Beans with Sausage)</a>, <a href=\"https://spoonacular.com/recipes/pasta-e-fagioli-pasta-and-beans-by-sarah-olsen-630921\">Pastan E Fagioli (Pastan and Beans) by Sarah Olsen</a>, and <a href=\"https://spoonacular.com/recipes/pasta-e-fagioli-pasta-and-beans-566878\">Pastan e Fagioli (Pastan and Beans)</a>.",
