    "imageType": "jpg",
    "summary": "This recipe serves 2 and costs $2.34 per serving. One serving contains <b>873 calories</b>, <b>21g of protein</b>, and <b>39g of fat</b>. This recipe from Foodista has 260 fans. It will be a hit at your <b>valentin day</b> event. A mixture of water, marshmallow creme, skim milk, and a handful of other ingredients are all it takes to make this recipe so yummy. From preparation to the plate, this recipe takes roughly <b>15 minutes</b>. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 83%</b>. This score is awesome. Try <a href=\"https://spoonacular.com/recipes/chocolate-soup-639203\">Chocolate Soup</a>, <a href=\"https://spoonacular.com/recipes/chocolate-soup-210542\">Chocolate soup</a>, and <a href=\"https://spoonacular.com/recipes/mint-chocolate-dessert-soup-717335\">Mint Chocolate Dessert Soup</a> for similar recipes.",
