    "summary": "The recipe Creamy Chicken Tikka Masala could satisfy your Indian craving in about <b>45 minutes</b>. This recipe makes 4 servings with <b>570 calories</b>, <b>23g of protein</b>, and <b>50g of fat</b> each. For <b>$2.22 per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. A couple people made this recipe, and 11 would say it hit the spot. If you have butter, cilantro, cayenne pepper, and a few other ingredients on hand, you can make it. It is a good option if you're following a <b>gluten free and primal</b> diet. It works well as a main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 55%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/chicken-in-creamy-tomato-curry-chicken-tikka-masala-311933\">Chicken in Creamy Tomato Curry: Chicken Tikka Masala</a>, <a href=\"https://spoonacular.com/recipes/chicken-tikka-masala-how-to-make-chicken-tikka-masala-665989\">chicken tikka masala , how to make chicken tikka masala</a>, and <a href=\"https://spoonacular.com/recipes/paneer-tikka-masala-sanjeev-kapoor-how-to-make-paneer-tikka-masala-630787\">paneer tikka masala (sanjeev kapoor), how to make paneer tikka masala</a> for similar recipes.",
