    "summary": "Fast Tiramisu requires about <b>approximately 45 minutes</b> from start to finish. One serving contains <b>436 calories</b>, <b>7g of protein</b>, and <b>35g of fat</b>. This recipe serves 12 and costs 78 cents per serving. 10 people have made this recipe and would make it again. A couple people really liked this Mediterranean dish. A mixture of heavy whipping cream, rum / brandy / coffee liqueur, cocoa powder, and a handful of other ingredients are all it takes to make this recipe so tasty. It is brought to you by Foodista. Overall, this recipe earns a <b>rather bad spoonacular score of 16%</b>. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/fast-easy-tiramisu-68014\">Fast & Easy Tiramisu</a>, <a href=\"https://spoonacular.com/recipes/fast-easy-tiramisu-366403\">Fast & Easy Tiramisu</a>, and <a href=\"https://spoonacular.com/recipes/fast-fast-fast-soda-bread-132708\">Fast Fast Fast Soda Bread</a>.",
