    "summary": "Cinnamon Eggless Coffee Cake is a <b>lacto ovo vegetarian</b> breakfast. This recipe serves 6 and costs 58 cents per serving. One portion of this dish contains around <b>5g of protein</b>, <b>18g of fat</b>, and a total of <b>375 calories</b>. If you have vanillan essence, curd, salt, and a few other ingredients on hand, you can make it. Not a lot of people made this recipe, and 6 would say it hit the spot. This recipe is typical of Southern cuisine. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is brought to you by Foodista. With a spoonacular <b>score of 15%</b>, this dish is not so tremendous. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/eggless-dates-walnut-coffee-cake-eggless-cake-s-486685\">eggless dates walnut coffee cake | eggless cake s</a>, <a href=\"https://spoonacular.com/recipes/eggless-apple-cinnamon-muffin-eggless-muffins-622027\">Eggless Apple Cinnamon Muffin | Eggless muffins</a>, and <a href=\"https://spoonacular.com/recipes/mug-cinnamon-coffee-cake-with-coffee-mate-extra-sweet-creamy-562548\">Mug Cinnamon Coffee Cake with Coffee-mate Extra Sweet & Creamy</a>.",
