    "summary": "The recipe Slow Cooker Lamb Curry is ready <b>in about 45 minutes</b> and is definitely a super <b>gluten free</b> option for lovers of Indian food. For <b>$3.57 per serving</b>, this recipe <b>covers 42%</b> of your daily requirements of vitamins and minerals. This recipe makes 8 servings with <b>568 calories</b>, <b>67g of protein</b>, and <b>24g of fat</b> each. Head to the store and pick up baking potatoes, rosemary, ginger, and a few other things to make it today. To use up the curry paste you could follow this main course with the <a href=\"https://spoonacular.com/recipes/chocolate-hazelnut-decadence-cake-pop-738246\">Chocolate Hazelnut Decadence Cake Pop</a> as a dessert. 19 people have made this recipe and would make it again. A couple people really liked this main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 93%</b>. This score is spectacular. Try <a href=\"https://spoonacular.com/recipes/leg-of-lamb-for-the-slow-cooker-crock-pot-96966\">Leg of Lamb for the Slow Cooker / Crock Pot</a>, <a href=\"https://spoonacular.com/recipes/slow-cooker-lamb-shanks-484177\">Slow Cooker Lamb Shanks</a>, and <a href=\"https://spoonacular.com/recipes/slow-cooker-lamb-stroganoff-517174\">Slow Cooker Lamb Stroganoff</a> for similar recipes.",
