    "summary": "Forget going out to eat or ordering takeout every time you crave Cajun food. Try making How to Make the Best Chicken Jambalayan at home. Watching your figure? This gluten free recipe has <b>451 calories</b>, <b>26g of protein</b>, and <b>21g of fat</b> per serving. For <b>$1.86 per serving</b>, you get a main course that serves 8. 2169 people have tried and liked this recipe. Head to the store and pick up ▢ chicken stock, ▢ celery, ▢ chicken breasts, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>55 minutes</b>. It is brought to you by Pink When. All things considered, we decided this recipe <b>deserves a spoonacular score of 0%</b>. This score is very bad (but still fixable). If you like this recipe, you might also like recipes such as <a href=\"https://spoonacular.com/recipes/chicken-jambalaya-397371\">Chicken Jambalaya</a>, <a href=\"https://spoonacular.com/recipes/chicken-jambalaya-1300201\">Chicken Jambalaya</a>, and <a href=\"https://spoonacular.com/recipes/chicken-jambalaya-ii-328195\">Chicken Jambalayan II</a>.",
