    "imageType": "jpg",
    "summary": "You can never have too many side dish recipes, so give Buckwheat Galette With An Egg a try. This lacto ovo vegetarian recipe serves 10 and costs <b>18 cents per serving</b>. One serving contains <b>87 calories</b>, <b>4g of protein</b>, and <b>4g of fat</b>. It is brought to you by Foodista. 93 people were impressed by this recipe. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. If you have milk, flour, sea salt, and a few other ingredients on hand, you can make it. Overall, this recipe earns a <b>not so amazing spoonacular score of 15%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/fruit-galette-with-buckwheat-crust-988598\">Fruit Galette with Buckwheat Crust</a>, <a href=\"https://spoonacular.com/recipes/egg-filled-buckwheat-pancake-257048\">Egg Filled Buckwheat Pancake</a>, and <a href=\"https://spoonacular.com/recipes/spinach-and-buckwheat-egg-bake-551432\">Spinach and Buckwheat Egg Bake</a>.",
