    "summary": "If you want to add more <b>gluten free and dairy free</b> recipes to your recipe box, Grilled Chicken with Sateay Sauce might be a recipe you should try. This recipe makes 4 servings with <b>938 calories</b>, <b>58g of protein</b>, and <b>65g of fat</b> each. For <b>$3.47 per serving</b>, this recipe <b>covers 34%</b> of your daily requirements of vitamins and minerals. A mixture of sherry, olive oil, small-diced onion, and a handful of other ingredients are all it takes to make this recipe so delicious. <b>The Fourth Of July</b> will be even more special with this recipe. Only a few people made this recipe, and 9 would say it hit the spot. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 74%</b>, which is solid. Similar recipes include <a href=\"https://spoonacular.com/recipes/grilled-chicken-wings-with-spicy-chipotle-hot-sauce-and-blue-cheese-yogurt-dipping-sauce-320519\">Grilled Chicken Wings with Spicy Chipotle Hot Sauce and Blue Cheese-Yogurt Dipping Sauce</a>, <a href=\"https://spoonacular.com/recipes/cornell-chicken-grilled-chicken-with-white-barbecue-sauce-195842\">Cornell Chicken (Grilled Chicken With White Barbecue Sauce)</a>, and <a href=\"https://spoonacular.com/recipes/biltmore-estate-chicken-breasts-over-rigatoni-rich-gorgonzola-sauce-covers-grilled-chicken-and-pasta-599145\">Biltmore Estate Chicken Breasts Over Rigatoni – rich Gorgonzola sauce covers grilled chicken and pasta</a>.",
