    "instructions": "<ol><li>Step 1: Prepare the frosting by melting the chocolate in a double broiler. When the chocolate has melted, add heavy cream and coffee extract. Mix well and chill in the refrigerator until needed. Dont combine the mascarpone cheese, yet.</li><li>Step 2: Preheat oven to 350 degrees F and line the cupcake pan with Halloween baking cups. In a large bowl, combine the the cake flour, cocoa powder, baking powder, baking soda, and salt.</li><li>Step 3: In another large mixing bowl, mix together the oil, sugar, egg, and vanilla and coffee extract and mix well. Then add the buttermilk and mix well again.</li><li>Step 4: Now stir in the flour mixture and mix until well combined.</li><li>Step 5: Pour the batter into a ziploc or piping bag and pipe into the cupcake pan. Bake for 20 to 25 minutes or until an inserted toothpick comes out clean (I baked mine for about 24 minutes).</li><li>Step 6: Let the cupcakes cool in the pan for about 5 to 10 minutes and then transfer them to a rack to cool completely.</li><li>Step 7: While cupcakes are cooling, make the chocolate decorations. Melt the chocolate and use a ziploc or piping bag to pipe out your design onto some parchment paper. Sprinkle the halloween sprinkles before the chocolate hardens. Chill in freezer until needed.</li><li>Step 8: Finish the frosting. Using an electric mixer, beat the mascarpone cheese until light and fluffy. Add the cooled chocolate cream mixture from earlier and beat until combined.</li><li>Step 9: Roughly spread the frosting on the cooled cupcakes. Dust with cocoa powder and decorate with sprinkles and chocolate.</li></ol>",
