    "summary": "White Chocolate Christmas Holiday Pretzels and Santa’s Snack Mix might be just the side dish you are searching for. This recipe makes 9 servings with <b>667 calories</b>, <b>12g of protein</b>, and <b>28g of fat</b> each. For <b>$1.55 per serving</b>, this recipe <b>covers 13%</b> of your daily requirements of vitamins and minerals. Plenty of people made this recipe, and 3413 would say it hit the spot. A mixture of peanuts, popped popcorn, dove® chocolate candies, and a handful of other ingredients are all it takes to make this recipe so flavorful. It can be enjoyed any time, but it is especially good for <b>Christmas</b>. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 52%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/santa-hat-white-chocolate-pretzels-600516\">Santa Hat White Chocolate Pretzels</a>, <a href=\"https://spoonacular.com/recipes/white-trash-holiday-snack-mix-622069\">White Trash Holiday Snack Mix</a>, and <a href=\"https://spoonacular.com/recipes/white-chocolate-santa-mix-563626\">White Chocolate Santa Mix</a> for similar recipes.",
