    "summary": "Need a <b>pescatarian main course</b>? Crabby Corn Chowder could be an awesome recipe to try. For <b>$4.65 per serving</b>, this recipe <b>covers 30%</b> of your daily requirements of vitamins and minerals. One serving contains <b>555 calories</b>, <b>27g of protein</b>, and <b>30g of fat</b>. Not a lot of people made this recipe, and 8 would say it hit the spot. A mixture of yukon gold potatoes, celery, corn kernels, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the butter you could follow this main course with the <a href=\"https://spoonacular.com/recipes/cinnamon-butter-cake-60334\">Cinnamon Butter Cake</a> as a dessert. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 76%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/crabby-clam-chowder-607164\">Crabby Clam Chowder</a>, <a href=\"https://spoonacular.com/recipes/oscar-party-crabby-snacks-and-homemades-except-just-crabby-snacks-511853\">Oscar Party: Crabby Snacks and Homemades (Except Just Crabby Snacks)</a>, and <a href=\"https://spoonacular.com/recipes/corn-chowder-117865\">Corn Chowder</a> for similar recipes.",
