    "summary": "One serving contains <b>553 calories</b>, <b>9g of protein</b>, and <b>37g of fat</b>. For <b>$1.33 per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. A few people made this recipe, and 17 would say it hit the spot. If you have cream cheese, vanillan extract, granulated sugar, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>1 hour and 30 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 24%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/white-chocolate-blueberry-cheesecake-543349\">White Chocolate Blueberry Cheesecake</a>, <a href=\"https://spoonacular.com/recipes/blueberry-and-white-chocolate-cheesecake-51501\">Blueberry And White Chocolate Cheesecake</a>, and <a href=\"https://spoonacular.com/recipes/no-bake-white-chocolate-blueberry-cheesecake-718890\">No Bake White Chocolate Blueberry Cheesecake</a> for similar recipes.",
