    "summary": "Need a <b>gluten free main course</b>? Homemade Broccoli Cheddar Soup could be an amazing recipe to try. This recipe makes 4 servings with <b>624 calories</b>, <b>22g of protein</b>, and <b>45g of fat</b> each. For <b>$3.16 per serving</b>, this recipe <b>covers 36%</b> of your daily requirements of vitamins and minerals. It is perfect for <b>Autumn</b>. 17 people found this recipe to be yummy and satisfying. It is brought to you by Foodista. Head to the store and pick up salt, cheddar cheese, yogurt, and a few other things to make it today. From preparation to the plate, this recipe takes around <b>around 45 minutes</b>. Overall, this recipe earns an <b>awesome spoonacular score of 90%</b>. Try <a href=\"https://spoonacular.com/recipes/cheddar-broccoli-potato-soup-with-homemade-herb-croutons-835630\">Cheddar Broccoli Potato Soup with Homemade Herb Croutons</a>, <a href=\"https://spoonacular.com/recipes/broccoli-cheddar-soup-110790\">Broccoli & Cheddar Soup</a>, and <a href=\"https://spoonacular.com/recipes/broccoli-cheddar-soup-535635\">Broccoli Cheddar Soup</a> for similar recipes.",
