    "summary": "Dutch Baby is a <b>vegetarian</b> side dish. For <b>63 cents per serving</b>, this recipe <b>covers 12%</b> of your daily requirements of vitamins and minerals. This recipe makes 4 servings with <b>310 calories</b>, <b>10g of protein</b>, and <b>11g of fat</b> each. This recipe is liked by 21 foodies and cooks. A mixture of eggs, milk, butter, and a handful of other ingredients are all it takes to make this recipe so flavorful. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 47%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/going-dutch-apple-spice-buttermilk-dutch-baby-864590\">Going Dutch: Apple-Spice Buttermilk Dutch Baby</a>, <a href=\"https://spoonacular.com/recipes/dutch-baby-808702\">Dutch Baby</a>, and <a href=\"https://spoonacular.com/recipes/dutch-baby-141619\">Dutch Baby</a> for similar recipes.",
