    "id": 794351,
    "title": "Summery Tomato Soup with Pasta and Chickpeas",
    "readyInMinutes": 45,
    "servings": 5,
    "sourceUrl": "http://foodandspice.blogspot.com/2016/07/summery-tomato-soup-with-pasta-and.html",
    "image": "https://spoonacular.com/recipeImages/794351-556x370.jpg",
    "imageType": "jpg",
    "summary": "Summery Tomato Soup with Pastan and Chickpeas is a <b>dairy free</b> soup. One serving contains <b>87 calories</b>, <b>3g of protein</b>, and <b>2g of fat</b>. For <b>59 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. If you have amchoor powder, ground cumin, peas, and a few other ingredients on hand, you can make it. 115 people were impressed by this recipe. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 80%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/pasta-with-chickpeas-and-tomato-sauce-31454\">Pasta With Chickpeas And Tomato Sauce</a>, <a href=\"https://spoonacular.com/recipes/roasted-tomato-pasta-with-chickpeas-recipe-31546\">Roasted Tomato Pasta With Chickpeas Recipe</a>, and <a href=\"https://spoonacular.com/recipes/tuscan-beans-in-summery-tomato-rag-154080\">Tuscan Beans in Summery Tomato Ragù</a> for similar recipes.",
